import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    Routes
  } from "react-router-dom";
import Home from '../home/Home';
class RouterURL extends Component {
    render() {
        return (
                <div>
                    <Routes>
                        <Route path="/" Component={Home} />

                    </Routes>
                    
                </div>
            
            
        );
    }
}

export default RouterURL;
